import React from 'react';

import styles from './Footer.module.css';

const Footer = (props) => (
  <footer className={styles.Footer}>
    <section>
      <h2>
        Reach me by email at bliamrethore@gmail.com or use one of the links
        below.
      </h2>
    </section>
    <section></section>
    <section></section>
    <span>Last Updated: MM.DD.2020</span>
    <span>
      <a href="\">Github Source Code</a>
    </span>
    <span>&copy;2020. All Rights Reserved.</span>
  </footer>
);

export default Footer;
